import React from 'react';
import '../css/promo.css'

function Oval()
{
  return (
    
    <div className='oval-container'>
        <div class="circle">
            <div class="tick"></div>
            <svg id="Grupo_13" data-name="Grupo 13" xmlns="http://www.w3.org/2000/svg" width="581" height="442" viewBox="0 0 381 442">
  <g id="Grupo_2" data-name="Grupo 2" transform="translate(0)">
    <g id="Rectángulo_1" data-name="Rectángulo 1" fill="#fff" stroke="#474747" stroke-width="1">
      <rect width="381" height="442" rx="32" stroke="none"/>
      <rect x="0.5" y="0.5" width="580" height="641" rx="31.5" fill="none"/>
    </g>
  </g>
  
</svg>

        </div>
    </div>
  )
}

export default Oval;
